import React from 'react';
import { BrowserRouter, Route, Link } from 'react-router-dom';
import Home from './Test';
import NewPage from './Add';

function App() {
  return (
    <BrowserRouter>
      <nav>
        <Link to="/">Accueil</Link>
        <Link to="./Test.js">Aller vers une autre page</Link>
      </nav>

      <Route exact path="/" component={Home} />
      <Route path="/Test.js" component={NewPage} />
    </BrowserRouter>
  );
}

export default App;
